import Expenses from './components/Expenses/Expenses'
import NewExpense from './components/Expenses/NewExpesnse/NewExpense';

const App=()=> {
  const expenses = [
    {
      'expDate': new Date(2021,2,2),
      'expTitle':'Car Insurance',
      'expAmount':'277.6'
    },
    {
      'expDate': new Date(2022,3,2),
      'expTitle':'New TV Insurance',
      'expAmount':'297.6'
    },
    {
      'expDate': new Date(2023,12,22),
      'expTitle':'Modem Insurance',
      'expAmount':'797.6'
    }
  ]
  return (
    <div>
      <NewExpense></NewExpense>
      <Expenses expenses = {expenses}></Expenses>     
    </div>
  );
}

export default App;
